    false,nt"url": null,nt"notes": "The presence of invasive species at Silvio
    O. Conte NFWR threatens many of the resources and habitats that the refuge is tasked
    with protecting. Both the wetlands and forest habitat continue to be impacted by
    invasive plants. For example, invasive shrubs such as Oriental bittersweet (Celastrus
    orbiculatus), Japanese barberry (Berberis thunbergii), and multiflora rose (Rosa
    multiflora) already existed on the Fort River Division and on the surrounding private
    lands of the Salmon River Division. Efforts to stop the spread of Japanese stiltgrass
    (Microstegium vimineum) on the Salmon River Division and the invasive shrubs on
    the Fort River Division were already underway at the time of the inventory. An inventory
    of these and other invasive plants at Silvio O. Conte NFWR will improve strategic
    planning and increase the efficiency and effectiveness of invasive plant management
    operations already occurring on the refuge. As part of the pilot project, Utah State
    University was asked to conduct an inventory for targeted invasive non-native plants
    within portions of these three new divisions of the refuge. While the purpose of
    the larger project is to develop a guide for conducting inventories on refuges,
    this inventory also provided valuable information to meet the invasive species management
    goals established at Silvio O. Conte National Fish and Wildlife Refuge.",nt"owner_org":
